    /**
     * Convierte un número serial de Excel en una fecha válida en formato Carbon.
     * El 1 de enero de 1900 es el punto de inicio para Excel.
     */
    private function convertExcelDate($excelSerialDate)
    {
        // Verifica si el valor es numérico
        if (!is_numeric($excelSerialDate) || $excelSerialDate == 0) {
            return null; // Maneja el caso de fechas vacías o no válidas
        }

        // El 1 de enero de 1900 en formato Excel tiene el valor serial 1
        // Restamos 25569 para obtener el número de días desde el 1 de enero de 1970
        $unixTimestamp = ((float) $excelSerialDate - 25569) * 86400;

        return Carbon::createFromTimestamp($unixTimestamp);
    }

